import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Post extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { title } = this.props.post;
    return (
      <div>
        <Link to='/posts/comments'>{title}</Link>
      </div>
    );
  }
}

export default Post;
